_isFlushable() {

  if (!this.dictionary.data.P || !this._ended) {

    return false;

  }



  return this._children.every((child) => {

    if (typeof child === 'function') {

      return false;

    }

    if (child instanceof PDFStructureElement) {

      return child._isFlushable();

    }

    return true;

  });

